INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Hendrianto Tandungan', 4, 'Located on the mattirotasi road of Parepare city, on the beach or facing the sea. There are outdoor and indoor. Indoor is specifically for non-smoking rooms. Good service, parking on the side of the road is only a bit difficult for four-wheeled vehicles', 'Umum', 'Positif', 'Nol3');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Kaki Panjang', 5, 'Coffee is pare-pare at standard prices. One of the favorite places for young people here to hang out. Drink prices start from 18k, and they''re delicious. When I arrived, it was midday with friendly service. There are indoor and outdoor. If it''s really hot outside during the day, there is also a smoking room here.', 'Afternoon', 'Positif', 'Nol3');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Yuliana rahmawati', 5, 'Newly opened cafe on Jalan Mattiro Tasi. Went here yesterday and it was quite busy. Hopefully it will always be busy in the future. Because it is still new, the food menu may need to be redesigned again. It''s like it was made in a way that makes the cafe branding even less good. The layout of the cafe is attractive. Especially because there are smoking and no smoking areas. In the smoking area the seating arrangement is good. So it can accommodate more people, there are also lots of charging places, suitable for a coworking space for those who like to work in cafes.', 'Working', 'Positif', 'Nol3');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Nursalam', 1, 'Reservation 2 days in advance to break the fast, the food was already at 8 and not all of it had come out yet, üôè please add more kitchen staff, especially during the fasting month, plus service please train again well üôè, customer satisfaction is number 1', 'Food', 'Positif', 'Nol3');
INSERT INTO reviews (nama_pengulas, rating_bintang, teks_ulasan, topik_utama, sentimen, nama_cafe) VALUES ('Wulan Kakstr', 1, 'I swear, the service is really bad. My order hasn''t been delivered for more than 2 hours, but when I complained, the female cashier said, "Why did you say that earlier?" HEHH Markonahh, I went to complain twice. At first the barista said, "Wait, sis, while it''s being made", I''ll wait, okay? I can still tolerate it, because I see it''s busy again. Eh, when you complained the second time to the female cashier, she said "why did you complain earlier", wow why was she the one who was angry? BTW, I wasn''t the only one who had to wait a long time, there were also 2 girls who arrived before me, and they delivered their food. Even though we ordered it first from someone outside, did the person outside get it first? Whoops, that''s really bad. I was forced to go home hungry, and my money was not returned. Not recommended guys. Be careful when you come here! BTW, haram is your sale that doesn''t respect people''s rights. It''s not just that I''m concerned about the food, it''s not our fault here, the cashier is even angry, that''s a shame!!! Replace the cashier with a girl, a friendlier one!', 'Food', 'Negatif', 'Nol3');
